When the query returns, three ratios are used later on to compute the transition function and the opinion forming. Confidence encapsulates the notion of how much we know (as a node) in relation to how much we will know in the near future (this being encoded in the look-ahead parameter l.) Evidence accumulated keeps the ratio of total positive votes vs the total votes received (positive and negative), whereas the evidence per round stores the ratio of the current round only. Parameters $$  egin{array}{lc} 	ext{Look-ahead parameter} & l = 20 
ewline 	ext{First evidence parameter} & \alpha_1 = 0.8 
ewline 	ext{Second evidence parameter} & \alpha_2 = 0.5 
ewline \end{array} $$ Computation $$  egin{array}{lc} 	ext{Confidence} & c{accum} \impliedby  rac{total\ votes}{total\ votes + l} 
ewline 	ext{Total accumulated evidence}& e{accum} \impliedby  rac{total\ positive\ votes}{total\ votes} 
ewline 	ext{Evidence per round} & e_{round} \impliedby  rac{round\ positive\ votes}{round\ votes} 
ewline \end{array} $$ The node runs the new_votes and positive_votes parameters received in the query round through the following algorithm: total_votes +== new_votes total_positive +== positive_votes confidence \<-- total_votes / (total_votes + look_ahead) total_evidence \<-- total_positive / total_votes new_evidence \<-- positive_votes / new_votes evidence \<-- new_evidence * ( 1 - confidence ) + total_evidence * confidence alpha \<-- doubt * ( 1 - confidence ) + certainty * confidence

The next step is a simple one: change our opinion if the threshold alpha is reached. This needs to be done separately for the YES/NO decision, checking both boundaries. The last step is then to decide on the current opinion. For that, a confidence threshold is employed. This threshold is derived from the network size, and is directly related to the number of total votes received. Decision $$  egin{array}{cl} evidence > \alpha & \implies 	ext{opinion YES} 
ewline evidence \< 1 - \alpha & \implies 	ext{opinion NO} 
ewline if\ 	ext{confidence} > c_{target} & THEN \ 	ext{finalize decision} 
ewline \end{array} $$ After the OPINION phase is executed, the current value of confidence is considered: if confidence exceeds a threshold derived from the network size and directly related to the total votes received, an honest node marks the decision as final, and always returns this opinion is response to further queries from other nodes on the network. IF confidence \> confidence_threshold OR round \> max_rounds THEN finalized \<-- T QUERY LOOP TERMINATES ELSE round +== 1 QUERY LOOP CONTINUES Thus, after the decision phase, either a decision has been finalized and the local node becomes quiescent never initiating a new query, or it initiates a new query.
